/* eslint-disable jsx-a11y/accessible-emoji */
import React from "react";
import "../css/Footer.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


export const Footer = () => (
    <div className="footer">
        <h3><span> 👩🏻‍💻</span> <a href="https://github.com/codingwithkat">GitHub</a> <a href="https://www.linkedin.com/in/katerina-papaloukas/">LinkedIn</a></h3>
        <p className="copyright">© 2020 Katerina Papaloukas</p>
        <FontAwesomeIcon icon="coffee" />
    </div>
);
